    @staticmethod
    def plot():
        # LOAD DATASETS
        iris = GeoDataFrameDemos3.irisPasDuLoupInMontpellier()
        buildings = GeoDataFrameDemos3.irisPasDuLoupInMontpellierBuildings()
        roads = GeoDataFrameDemos3.irisPasDuLoupInMontpellierRoads()
        grid = GeoDataFrameDemos3.irisPasDuLoupInMontpellierINSEEGrid()

        # MAPPING
        fig, basemap = plt.subplots(figsize=(1 * 8.26, 1 * 8.26))
        # grid.plot(ax=basemap, column='Ind', alpha=0.95, legend=True)
        iris.boundary.plot(ax=basemap, color='red')
        buildings.plot(ax=basemap, color='grey', edgecolor='white')
        roads.plot(ax=basemap, color='black', linewidth=1)
        grid.boundary.plot(ax=basemap, color='green', linewidth=1)
        plt.show()
        plt.close(fig)

